import React from 'react';
import './App.css';

const mensaje = () => {
  return <h1>Hola funciona desde modulo</h1>
}


const App = () => {
  return (
    <div className="App">

     <mensaje/>
     <h1>Hola Mundo</h1>
    </div>
  );
}

export default App;
